import React, { useState } from "react";
import { Questions } from "./api";


const Interview = () => {
    const [val , setVal] = useState(Questions)
    return (
        <>
            {
                val.map((e)=>{
                    return(
                        <>
                        <button>+</button>
                        <h1>{e.Q} </h1>
                        </>
                    )
                
                })
            }
        </>
    )
}

export default Interview;
